/*Compute P = rhoRT/W(y) */
void CKPY(double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW = 0;/* for computing mean MW */
    YOW += y[0]*imw[0]; /*H2 */
    YOW += y[1]*imw[1]; /*H */
    YOW += y[2]*imw[2]; /*O */
    YOW += y[3]*imw[3]; /*O2 */
    YOW += y[4]*imw[4]; /*OH */
    YOW += y[5]*imw[5]; /*H2O */
    YOW += y[6]*imw[6]; /*HO2 */
    YOW += y[7]*imw[7]; /*H2O2 */
    YOW += y[8]*imw[8]; /*C */
    YOW += y[9]*imw[9]; /*CH */
    YOW += y[10]*imw[10]; /*CH2 */
    YOW += y[11]*imw[11]; /*CH2* */
    YOW += y[12]*imw[12]; /*CH3 */
    YOW += y[13]*imw[13]; /*CH4 */
    YOW += y[14]*imw[14]; /*CO */
    YOW += y[15]*imw[15]; /*CO2 */
    YOW += y[16]*imw[16]; /*HCO */
    YOW += y[17]*imw[17]; /*CH2O */
    YOW += y[18]*imw[18]; /*CH2OH */
    YOW += y[19]*imw[19]; /*CH3O */
    YOW += y[20]*imw[20]; /*CH3OH */
    YOW += y[21]*imw[21]; /*C2H */
    YOW += y[22]*imw[22]; /*C2H2 */
    YOW += y[23]*imw[23]; /*C2H3 */
    YOW += y[24]*imw[24]; /*C2H4 */
    YOW += y[25]*imw[25]; /*C2H5 */
    YOW += y[26]*imw[26]; /*C2H6 */
    YOW += y[27]*imw[27]; /*HCCO */
    YOW += y[28]*imw[28]; /*CH2CO */
    YOW += y[29]*imw[29]; /*HCCOH */
    YOW += y[30]*imw[30]; /*AR */
    YOW += y[31]*imw[31]; /*N2 */
    YOW += y[32]*imw[32]; /*CH2CHO */
    YOW += y[33]*imw[33]; /*C3H2 */
    YOW += y[34]*imw[34]; /*C3H3 */
    YOW += y[35]*imw[35]; /*pC3H4 */
    YOW += y[36]*imw[36]; /*aC3H4 */
    YOW += y[37]*imw[37]; /*cC3H4 */
    YOW += y[38]*imw[38]; /*C4H2 */
    YOW += y[39]*imw[39]; /*H2C4O */
    YOW += y[40]*imw[40]; /*n-C4H3 */
    YOW += y[41]*imw[41]; /*i-C4H3 */
    YOW += y[42]*imw[42]; /*C4H4 */
    YOW += y[43]*imw[43]; /*n-C4H5 */
    YOW += y[44]*imw[44]; /*i-C4H5 */
    YOW += y[45]*imw[45]; /*C4H6 */
    YOW += y[46]*imw[46]; /*C4H612 */
    YOW += y[47]*imw[47]; /*C4H81 */
    YOW += y[48]*imw[48]; /*C4H7 */
    YOW += y[49]*imw[49]; /*C6H2 */
    YOW += y[50]*imw[50]; /*C6H3 */
    YOW += y[51]*imw[51]; /*l-C6H4 */
    YOW += y[52]*imw[52]; /*c-C6H4 */
    YOW += y[53]*imw[53]; /*A1 */
    YOW += y[54]*imw[54]; /*A1- */
    YOW += y[55]*imw[55]; /*C6H5O */
    YOW += y[56]*imw[56]; /*C6H5OH */
    YOW += y[57]*imw[57]; /*C5H6 */
    YOW += y[58]*imw[58]; /*C5H5 */
    YOW += y[59]*imw[59]; /*C5H5O */
    YOW += y[60]*imw[60]; /*C5H4OH */
    YOW += y[61]*imw[61]; /*C5H4O */
    YOW += y[62]*imw[62]; /*C3H8 */
    YOW += y[63]*imw[63]; /*nC3H7 */
    YOW += y[64]*imw[64]; /*iC3H7 */
    YOW += y[65]*imw[65]; /*C3H6 */
    YOW += y[66]*imw[66]; /*aC3H5 */
    YOW += y[67]*imw[67]; /*CH3CCH2 */
    YOW += y[68]*imw[68]; /*CH3CHO */
    YOW += y[69]*imw[69]; /*C2H3CHO */
    *P = *rho * 8.31451e+07 * (*T) * YOW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void VCKPY(int * restrict np, double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW[*np];
    for (int i=0; i<(*np); i++) {
        YOW[i] = 0.0;
    }

    for (int n=0; n<70; n++) {
        for (int i=0; i<(*np); i++) {
            YOW[i] += y[n*(*np)+i] * imw[n];
        }
    }

    for (int i=0; i<(*np); i++) {
        P[i] = rho[i] * 8.31451e+07 * T[i] * YOW[i]; /*P = rho*R*T/W */
    }

    return;
}


